import React, { useState, useEffect } from "react";
import Axios from "axios";
import "./Style.css";
import Select from "react-select";

function SearchBar({ placeholder, data }) {

  const [profileList, setProfileList] = useState([]);

  useEffect(() => {
    Axios.get('http://localhost:3001/profileslist').then((response) => {
      setProfileList(response.json());
      console.log("profileList: " +profileList)

      console.log("response.data[0]: " +response.data[0].name)
    });
  }, []);

  const profiles = [
    { value: "2", label: "Flávio" },
    { value: "7", label: "Vinícius" },
    { value: "8", label: "Vanessa" },
  ];

  return (
    <div className="search">
      <Select
        className="searchInput"
        classNamePrefix="select"
        isClearable={true}
        isSearchable={true}
        name="profile"
        options={profileList}
        placeholder="Busque um Repo"
      />
    </div>
  );
}

export default SearchBar;
